                </li>
                <li>
                     <Link to="/Lien3">LIEN 3 INTERNE </Link>
                </li>
                <li>
                     <Link to="/Lien4">LIEN 4 INTERNE </Link>
                </li>
                <li>
                <Navbar.Brand href="https://www.wikipedia.com"> </Navbar.Brand>
                </li>
                <li>
                     <Link to="https://www.wikipedia.com">LIEN 2 EXTERNE </Link>
                </li>
            </div>


        </div>
      );
      }

export default LeftNav;
